import React from 'react';
import LoginForm from '../components/auth/LoginForm';

const LogIn = () => {
  return (
    <div className='login'>
      <div className='login-wrapper'>
         <div className='login-header'>
           <h1>Log-In</h1>
          </div>
          <div className='login-form-wrapper'>
            <LoginForm />
          </div>

      </div>


    </div>
  );
}

export default LogIn;
